function addCssLink(dep) {
    const link = input.dom.createElement('link')
    link.rel = 'stylesheet'
    link.href = dep.path
    return link
}

function addLinkToHeadIfMissing(link) {
    let found = false
    input.dom.querySelectorAll('link').forEach(headLink => {
        if(found) return;
        found = headLink.href === link.href
    })
    !found && input.dom.head.appendChild(link)
}

input.dependencies.filter(dep => dep.deptype === 'css').map(dep => addLinkToHeadIfMissing(addCssLink(dep)))
